import React from "react";
import s from './ProfileInfo.module.css';

const ProfileInfo = () => {
    return (
        <div>
        <div>
          <img src='https://klike.net/uploads/posts/2020-09/1599834412_2.jpg'></img>
        </div>
        <div className={s.descriptionBlock}>
          <img src='https://st.depositphotos.com/1028911/3799/i/450/depositphotos_37997691-stock-photo-abstract-background-with-big-red.jpg'></img>
        </div>
      </div>
    )  
};

export default ProfileInfo;
